        return(
            <>
              <div>
                <Router>
                <ul className='navbar navbar-expand-lg navbar-light' style={listStyle}>
                    
                    <li style={myStyle}>hi<Link to="/">Home</Link></li>
                    <li style={myStyle}><Link to="/login">Log in</Link></li>
                    <li style={myStyle}><Link to="/signin">Sing in</Link></li>
                    <li style={myStyle}><Link to="/about">About</Link></li>
